properties.description:
- claimed to be the largest uninhabited island on Earth (55,247 km2);
- the highest point is the Devon Ice Cap at 1,920 m (6,300 ft);
- contains suchl mountain ranges as the Treuter Mountains, Haddington Range and the Cunningham Mountains;
- supports only a meagre population of musk oxen and small birds and mammals;
- Cape Liddon is an Important Bird Area (IBA) notable for its Black Guillemot and Northern Fulmar populations; 
- Cape Vera, another IBA site, is also noted for its Northern Fulmar population.

Axel Heiberg Island: 
- uninhabited;
- fossil forests, which date from the Eocene period;
- White Glacier is a valley glacier occupying 38.7 km2 in the Expedition Fiord area of Axel Heiberg Island (island area 43,178 km2).

 Ellesmere Island:

- fifth largest island in the world (507,451 km2);
- Mount Odin is the highest peak, with an elevation of at least 2,143 m (7,031 ft);
- Auyuittuq National Park (only 12 species of mammals live here including Lemmings Arctic Hare, and Ermine to Polar Bear, Arctic Fox, and some Barren-ground Caribou).

- uninhabitated;
- area 42,149 km2;
- mountains reach heights of 1000 m;

- Melville has surfaced as a candidate for natural gas deposits. The island was believed to have deposits of coal and oil shale since the first half of the 20th century. The first Canadian Arctic island exploratory well was spudded in 1961 at Winter Harbour. It drilled Lower Paleozoic strata to a total depth of 3,823 m (12,543 ft). In the 1970s, the northern portion of the island on the east side of the Sabine Peninsula proved to contain a major gas field, known as Drake Point. The lease was owned by Panarctic Oils, a joint operation with the Canadian Government.
